import React, { Component } from "react";
import { Col, Container, Row, Card, ProgressBar, Image } from "react-bootstrap";
import './PlaylistItem.css'

export default class PlaylistItem extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log(this.props);
    return (
      <>
        <Container>
          <Row>
          <Col sm={4}>
            <img className="playlist-thumbnail" src="https://www.techsmith.com/blog/wp-content/uploads/2021/02/video-thumbnails-hero-1.png" alt="playlist thumbnail"/>
          </Col>
          <Col sm={8}>
            <Row className="add-space">{this.props.name}</Row>
            <Row>{this.props.channel}</Row>
            <Row><ProgressBar now={60} /></Row>
          </Col>
          </Row>
        </Container>
      </>
    );
  }
}
